import classes from "./Navigation.module.css";
const Navigation = () => {
  return (
    <>
      <header className={classes.header}>
        <nav>
          <ul className={classes.list}>
            <li>HOME</li>

            <li>SHOP</li>
          </ul>
        </nav>
      </header>
    </>
  );
};

export default Navigation;
